import React, { Component } from 'react';
import { Bills } from '../../Fetches/Queries';

class Reports extends Component {
  constructor() {
    super();
    this.state = {
      bill: '',
      keys: ''
    };
    this.fetchBill = this.fetchBill.bind();
  }
  fetchBill = async () => {
    let a = await Bills();
    await this.setState({ bill: a, keys: a.map(i => Object.keys(i)) });
  };
  componentDidMount() {
    this.fetchBill();
  }
  render() {
    return <div>{this.state.keys.map(i => console.log(i))}HI</div>;
  }
}

export default Reports;
